import React from "react";
import { Link } from "react-router-dom";
import "../styles/Home.css";

const Home = () => {
  return (
    <div>
      <header id="header">
        <h1>Northside Youth Soccer League</h1>
      </header>
      <div id="title-bar">
        <h2>NYSL Game Information</h2>
      </div>
      <img id="logo" src="img/nysl_logo.png" alt="Northside Youth Soccer League Logo" />
      <nav id="nav-bar">
        <Link className="inactive-link" to="/">Home</Link>
        <Link className="inactive-link" to="/about">About <span className="about-variable">NYSL</span></Link>
        <Link className="inactive-link" to="/contact">Contact</Link>
        <Link className="inactive-link" to="/rules">Rules and Policies</Link>
        <Link className="active-link" to="/games">Game Information</Link>
        <Link className="inactive-link" to="/registration">Registration Form</Link>
      </nav>
      <main id="content">
        <h3>Welcome to the Northside Youth Soccer League!</h3>
        {/* Aquí puedes agregar más contenido para la página de inicio */}
      </main>
    </div>
  );
};

export default Home;
